import React from 'react';
import { Switch, Route } from 'react-router-dom'
import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';

import AllPosts from './Posts/AllPosts'

function App() {
  return (
    <Switch>
      <Route path='/allPosts' render={() => <AllPosts />} />
    </Switch>
  );
}

export default App;
